    "2013-03-15T23:32:59.236693",nt"name": "selected-hydrologic-data-cache-valley-utah-and-idaho",nt"isopen":
    false,nt"url": null,nt"notes": "The system of numbering wells and springs
    in Utah is based on the cadastral land-survey system of the U.S. Government. The
    number identifies the well or spring and locates its position to the nearest 10-acre
    tract in the land net. By this system, the State is divided into four quadrants
    by the Salt Lake base line and meridian, and these quadrants are designated by the
    uppercase letters A, B, C, and D, thus: A, for the northeast quadrant; B, for the
    northwest; C, for the southwest; and D, for the southeast quadrant. Numbers designating
    the township and range, respectively, follow the quadrant letter, and the three
    are enclosed in parentheses. The number after the parentheses designates the section,
    and the letters following the section number give the location within the section.
    In text illustrations and typeset tables, these letters are lowercase, but in tables
    reproduced from computer listings (such as tables 1, 2, 3, and 5 in this report)
    all letters are uppercase. The first letter indicates the quarter section, which
    is generally a tract of 160 acres; the second letter indicates the 40-acre tract,
    and the third letter indicates the 10-acre tract. The numbers that follow the letters
    indicate the serial number of the well or spring within the 10-acre tract. ",nt"license_title":
